a URL odkazuje na soubor v knihovně médií %2$s I když byste měli být schopni použít tuto adresu URL v %3$s zkráceném kódu, bude to statický snímek kalendáře v době vytvoření souboru a nebude odrážet žádné budoucí aktualizace zdrojového kalendáře. Pokyny k získání správné adresy URL dynamického zdroje naleznete v naší %4$suživatelské příručce%5$s.','Error: Could not resolve IP address for %1$s.'=>'Chyba: Nepodařilo se přeložit IP adresu pro %1$s.','Resolved IP address for %1$s:'=>'Vyřešená IP adresa pro %1$s:','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Text zadaný do pole "Výchozí zkratka" není platnou zkratkou a nebyl uložen.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sNastavení aktualizováno.%2$s Pro zobrazení některých změn bude možná nutné stránku obnovit.','calendar event'=>'událost v kalendáři','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'Starší metoda vyžádání feedu je zastaralá a v blízké budoucnosti bude v rámci aktualizace odstraněna. Testujte prosím své kanály s vypnutou starší metodou vyžádání kanálů.','Map'=>'Mapa','Recurring event'=>'Opakující se akce','Recurs every %1$s years'=>'Opakuje se každých %1$s let','Recurs yearly'=>'Opakuje se každoročně','Recurs every %1$s months'=>'Opakuje se každých %1$s měsíců','Recurs monthly'=>'Opakuje se každý měsíc','Recurs every %1$s weeks'=>'Opakuje se každých %1$s týdnů','Recurs weekly'=>'Opakuje se každý týden','Recurs every %1$s days'=>'Opakuje se každých %1$s dní','Recurs daily'=>'Opakuje se denně','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'Zdá se, že vlastnost "url" ve vašem zkráceném kódu %1$s obsahuje značky HTML; pravděpodobně se vaše adresa URL změnila na odkaz, na který lze kliknout. V důsledku toho se váš kalendář nemusí zobrazovat správně. Odstraňte prosím klikací odkaz v krátkém kódu.','The r34ics_url_get_contents() function is no longer supported.'=>'Funkce r34ics_url_get_contents() již není podporována.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sUpozornění: %2$s %3$s verze 10.6 mění výchozí možnosti pro několik nastavení zkratek. V zájmu zachování konzistence nejsou tyto nové výchozí hodnoty %4$spři přechodu z dřívější verze %5$s povoleny. Pokud se chcete o změnách dozvědět více, přečtěte si prosím náš %6$spříspěvek na blogu%7$s, nebo pro přepnutí na nové výchozí nastavení zapněte %8$s možnost na stránce %9$s nastavení%10$s.','Use new parameter defaults (v.10.6)'=>'Použití nových výchozích parametrů (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sUpozornění: %2$s %3$s verze 11.0 zjednodušuje způsob načítání adres URL kanálů ICS. Tato změna využívá standardní vestavěnou funkci WordPressu, takže by měla být plně kompatibilní se všemi stávajícími instalacemi. Pokud se po aktualizaci na verzi 11 nebo novější setkáte s novými problémy, navštivte prosím %4$sFóra podpory WordPressu%5$s, kde získáte pomoc.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sUpozornění: %2$s %3$s verze 11.5.14.2 zavádí nový, bezpečnější způsob zpracování parametrů kalendáře při načítání pomocí AJAXu. Vymažte prosím všechny pluginy mezipaměti, které používáte, abyste zajistili správné načítání kalendářů pomocí nové metody.','Add %1$s'=>'Přidat %1$s','Close'=>'Zavřít','ICS Feed URL:'=>'Adresa URL kanálu ICS:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Ujistěte se, že používáte adresu URL %1$ssubscribe%2$s, nikoliv adresu URL %3$sweb view%4$s %5$s (zadáním adresy URL přímo do webového prohlížeče by mělo dojít ke stažení souboru %6$s)','Calendar Title:'=>'Název kalendáře:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Ponechte prázdné, chcete-li použít výchozí název kalendáře. Zadejte %1$s pro úplné vynechání názvu.','Calendar Description:'=>'Popis kalendáře:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Ponechte prázdné, chcete-li použít výchozí popis kalendáře. Zadejte %1$s pro úplné vynechání popisu.','View:'=>'Zobrazit:','month'=>'měsíc','list'=>'seznam','week'=>'týden','Count:'=>'Počítat:','Format:'=>'Formát:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Chcete-li zahrnout všechny nadcházející události, ponechte %1$s prázdné. %2$s musí být standardní řetězec %3$sformátu data PHP%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Zobrazit popisy událostí %1$s(změňte na číslo ve vloženém zkráceném kódu pro nastavení limitu slov)%2$s','Show event locations %1$s(if available)%2$s'=>'Zobrazit místa událostí %1$s(je-li k dispozici)%2$s','Show event organizers %1$s(if available)%2$s'=>'Zobrazit organizátory události %1$s(je-li k dispozici)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sPoznámka:%2$s Další %3$smožnosti zobrazení%4$s jsou k dispozici ruční úpravou zkráceného kódu po vložení.','Insert %1$s'=>'Vložit %1$s','Do even more with %1$s!'=>'S funkcí %1$s toho zvládnete ještě více!','Calendar Builder'=>'Tvůrce kalendáře','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Konfigurace všech nastavení kalendáře pomocí snadného vizuálního rozhraní... není třeba ručně zadávat zkratky.','Additional Views and Enhanced Features'=>'Další zobrazení a rozšířené funkce','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Nové způsoby zobrazení kalendáře, včetně Plný, Další, Zděný, Měsíc s postranním panelem, Widget a další. Do základních zobrazení Měsíc, Základní, Seznam a Týden byly přidány další možnosti.','Customizer'=>'Přizpůsobení','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Snadno upravte barevné palety kalendáře, písma a další prvky v rámci celého webu.','ICS Events'=>'Události ICS','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sNovinka!%2$s Změní %3$s na plnohodnotný kalendářní systém. Vytvářejte a spravujte události přímo ve WordPressu a dokonce je můžete hladce integrovat se stávajícími kanály.','Visit %1$s to learn more.'=>'Navštivte %1$s a dozvíte se více.','Go PRO!'=>'Go PRO!','Getting Started'=>'Začínáme','System Report'=>'Systémová zpráva','Save Changes'=>'Uložit změny','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Děkujeme za instalaci %1$s. Před vytvořením prvního zkráceného kódu kalendáře navštivte stránku %2$sObecná nastavení%3$s a zkontrolujte, zda jsou nastavení jazyka webu, časového pásma a formátu data a času správná. Další informace naleznete v naší %4$sUživatelské příručce%5$s.','Quick Start Guide'=>'Stručný návod k použití','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Rozsáhlá %1$sUživatelská příručka%2$s je k dispozici na našich webových stránkách. Níže uvádíme několik rychlých odkazů na klíčové zdroje v dokumentaci.','General:'=>'Obecné:','General WordPress Settings'=>'Obecná nastavení WordPressu','%1$s Settings'=>'%1$s Nastavení','Working with Shortcodes:'=>'Práce se zkratkami:','Shortcode Overview'=>'Přehled krátkých kódů','Shortcode Builder'=>'Stavitel Shortcodů','Shortcode Parameters Reference'=>'Odkaz na parametry krátkého kódu','Advanced Topics:'=>'Témata pro pokročilé:','FAQs and Tips'=>'Nejčastější dotazy a tipy','CSS Guide'=>'Průvodce CSS','Developer Resources'=>'Zdroje pro vývojáře','GDPR'=>'GDPR','Appearance'=>'Vzhled','Match calendar color palette to current Block Theme colors'=>'Shoda barevné palety kalendáře s aktuálními barvami tématu bloku','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Nahradí výchozí neutrální paletu barev %1$s nejbližšími barvami z aktuální palety barev Editoru stylů webu nebo ze souboru %2$s ve vašem motivu. Výběr barev je algoritmický a některé kombinace nemusí projít testy kontrastu přístupnosti. Toto nastavení nemá žádný vliv, pokud používáte "klasické" téma, které neobsahuje soubor %3$s.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$sV současné době se jedná o funkci beta%2$s, která může vyžadovat určité úpravy nastavení kalendáře nebo CSS pro optimální zobrazení, zejména pokud máte barevně odlišené kanály. Funkčnost se může změnit.','Dark mode'=>'Tmavý režim','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Invertuje barevnou paletu (světlé barvy na tmavém pozadí). %1$sPoznámka:%2$s Tmavý režim také automaticky aplikuje změny stylu podobně jako parametry %3$s a %4$s zkratky, takže je nemusíte do zkratky zahrnovat.','Loading'=>'Načítání','Always use AJAX to render calendars (recommended)'=>'Pro vykreslování kalendářů vždy používejte AJAX (doporučeno)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Pokud je tato možnost zaškrtnuta, všechny kalendáře se budou vykreslovat pomocí AJAXu (asynchronně po načtení stránky). To je užitečné zejména ve spojení s jinými pluginy pro ukládání do mezipaměti nebo pokud vaše kalendáře obsahují velké množství událostí. Za normálních okolností se data kalendáře odesílají přímo v HTML při prvním načtení stránky, pokud není v krátkém kódu zadán AJAX.','Increase memory limit when rendering calendars'=>'Zvýšení paměťového limitu při vykreslování kalendářů','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Pokud se kalendář nenačte s fatální chybou "nedostatek paměti", zkuste zvýšit limit paměti. Doporučuje se minimálně 512 MB. %1$s Poznámky: 1) Někteří poskytovatelé hostingu nemusí aplikacím umožnit přepsat výchozí nastavení serveru. 2) Tuto možnost není možné nastavit níže, než je aktuální výchozí limit paměti na serveru.','deprecated'=>'zastaralé','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Pokud váš web přestal načítat kanály po aktualizaci verze 11, zapněte tuto možnost, abyste použili starší metodu vyžádání. Tato funkce je zastaralá a v blízké budoucnosti bude v rámci aktualizace odstraněna.','Default shortcode'=>'Výchozí zkrácený kód','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Pokud bude váš web obsahovat velké množství podobně nakonfigurovaných zkratek kalendáře, můžete zde zadat výchozí "základní" zkratku s parametry, které by měly být pro všechny kalendáře stejné. Jednotlivé zkrácené kódy na webu pak mohou obsahovat pouze parametry, které jsou pro daný kalendář jako takový jedinečné: %1$s Jakékoli parametry obsažené v jednotlivých zkrácených kódech budou mít přednost před parametry nastavenými zde.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Povolení přístupu k těmto hostitelským jménům, která se překládají na vyhrazené IP adresy','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Pokud je server kalendáře umístěn na stejném fyzickém serveru jako vaše webové stránky, je součástí stejné místní sítě nebo jinak používá %1$svyhrazenou IP adresu%2$s, zadejte zde jeho název hostitele, abyste umožnili přístup. V případě více kalendářových serverů zadejte na každý řádek jeden název hostitele. Další informace naleznete v %3$sdokumentaci %4$s%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Na každý řádek zadejte jeden název hostitele. Hostitelské jméno je základní název domény, nikoli celá adresa URL. %1$s Například zadejte %2$s, nikoli %3$s.','Caching'=>'Mezipaměť','Transient (cache) expiration'=>'Přechodné vypršení platnosti (mezipaměti)','seconds'=>'sekund','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Nastavuje, jak dlouho mají být data kalendáře uložena v mezipaměti na serveru (přechodné stavy WordPressu) před opětovným načtením. Výchozí hodnota je 3600 (1 hodina).','Miscellaneous'=>'Ostatní','Remove "Add ICS Calendar" button in Classic Editor'=>'Odstranění tlačítka "Přidat kalendář ICS" v editoru Classic','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Ve výchozím nastavení přidává Kalendář ICS na panel nástrojů nad editor WYSIWYG při použití klasického editoru tlačítko "Přidat kalendář ICS". Zaškrtnutím tohoto políčka tlačítko odstraníte. Nemá žádný vliv na weby používající blokový editor (Gutenberg).','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s Verze 10.6 zavedla nové výchozí hodnoty pro několik parametrů zkratek. Nové instalace automaticky používají nové výchozí hodnoty, ale aktualizované instalace budou nadále používat staré výchozí hodnoty, pokud není toto políčko zaškrtnuto. Více informací o těchto změnách najdete na %2$snašem blogu%3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Na našich webových stránkách je k dispozici kompletní uživatelská příručka s úplným překladem do desítek jazyků:','For assistance, please use our %1$ssupport request form%2$s.'=>'Pro pomoc použijte náš %1$sformulář žádosti o podporu%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Při kontaktování podpory uveďte %1$sSystémovou zprávu%2$s z této stránky.','Spread the word!'=>'Zmieňte se o nás!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Pokud se vám %1$s zdá užitečné, můžete podpořit náš další růst a rozvoj %2$spětihvězdičkovým hodnocením%3$s. Děkujeme!','%1$s Data Cache'=>'%1$s Datová mezipaměť','Clear Cached Calendar Data'=>'Vymazání dat kalendáře v mezipaměti','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Tím se okamžitě vymažou všechna existující data kalendáře v mezipaměti (vyčistí se přechodné stavy) a při příštím zobrazení bude muset WordPress všechny kalendáře načíst znovu. Ukládání do mezipaměti se poté obnoví jako dříve.','ICS Feed URL Tester'=>'ICS Feed URL Tester','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Pokud se obáváte, že zásuvný modul nenačítá váš zdroj správně, můžete otestovat adresu URL zde.','Enter feed URL...'=>'Zadejte adresu URL kanálu...','Test URL'=>'Testovací adresa URL','Results:'=>'Výsledky:','%1$s received.'=>'%1$s přijato.','This appears to be a valid ICS feed URL.'=>'Zdá se, že se jedná o platnou adresu URL kanálu ICS.','This does not appear to be a valid ICS feed URL.'=>'Zdá se, že toto není platná adresa URL kanálu ICS.','Could not retrieve data from the requested URL.'=>'Nepodařilo se načíst data z požadované adresy URL.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Při pokusu o načtení požadované adresy URL došlo k neznámé chybě.','Please copy the following text and include it in your message when emailing support.'=>'Zkopírujte prosím následující text a uveďte jej do zprávy při zasílání e-mailu na podporu.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Také prosím uveďte zkratku %1$s přesně tak, jak jste ji zadali na dotčené stránce.','For your site security please do NOT post the System Report in the support forums.'=>'V zájmu bezpečnosti webu NEPOSÍLEJTE systémovou zprávu do fóra podpory.','No events found.'=>'Nebyly nalezeny žádné akce.','Previous Page'=>'Předchozí stránka','Next Page'=>'Další stránka','All Day'=>'Celý den','Today'=>'Dnes','No events.'=>'Žádné události.','No additional events this month.'=>'Tento měsíc se nekonají žádné další akce.','Last week'=>'Minulý týden','This week'=>'Tento týden','Next week'=>'Příští týden','ICS Calendar'=>'Kalendář ICS','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or 